// MediSync Frontend Structure (React + TailwindCSS)
// Required Dependencies
// npm install react-router-dom axios tailwindcss @headlessui/react @heroicons/react zustand
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/ho";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Dashboard from "./pages/Dashboard";
import Records from "./pages/Records";
import Upload from "./pages/Upload";
import AIChat from "./pages/AIChat";
import Emergency from "./pages/Emergency";
import Terms from "./pages/Terms";
import ProtectedRoute from "./components/ProtectedRoute";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={
          <ProtectedRoute><Dashboard /></ProtectedRoute>
        } />
        <Route path="/records" element={
          <ProtectedRoute><Records /></ProtectedRoute>
        } />
        <Route path="/upload" element={
          <ProtectedRoute role="doctor"><Upload /></ProtectedRoute>
        } />
        <Route path="/ai-chat" element={
          <ProtectedRoute><AIChat /></ProtectedRoute>
        } />
        <Route path="/emergency" element={
          <ProtectedRoute><Emergency /></ProtectedRoute>
        } />
        <Route path="/terms" element={<Terms />} />
      </Routes>
    </Router>
  );
}

export default App;
